import React from 'react'

const container = () => {
    const data = [
        {
            "data": [
                {
                    "name": "Cosmetics",
                    "productList": [
                        {
                            "name": "Hair Oil",
                            "price": 122
                        },
                        {
                            "name": "Face wash",
                            "price": 123
                        }
                    ]
                },
                {
                    "name": "Household",
                    "productList": [
                        {
                            "name": "Hair Oil",
                            "price": 122
                        },
                        {
                            "name": "Face wash",
                            "price": 123
                        }
                    ]
                }
            ]
        }
    ]
    const showdata = data[0].productlist[0].name;
    console.log(showdata);

    return (
        <div>
            <h1>Hello</h1>
        </div>
    )
}

export default container
